import {gql} from 'apollo-boost';

const getDistrictsQuery = gql`
   
{
    districts{
      districtname
      id
      projects{
          distributedyear
      }
    }
  }

`
const getProjectsQuery = gql`
   
    {
      projects{
        projectname
        bikenumber
        distributedyear
        districtid
        id
        
      }
    }

`

const addProjectMutation = gql`

mutation($projectname: String!, $bikenumber: Int, $distributedyear: Int $districtid: ID!){
    addProject(projectname:$projectname,bikenumber:$bikenumber,distributedyear:$distributedyear,districtid:$districtid){
        projectname
        bikenumber
        distributedyear
        districtid
    }
}

`

const addDistrictMutation = gql`

mutation($districtname: String!){
    addDistrict(districtname:$districtname){
      districtname
    }
  }
  
`

const getProjectQuery = gql`

    query($id: ID){
        project(id:$id){
            id
            projectname
            bikenumber
            distributedyear
            district{
                districtname
                
            }
        }

    }

`

const deleteProjectMuattion =gql`

mutation($id: ID!){
    deleteProject(id:$id){
      id
  
    }
  }

`

const deleteDistrictMutation =gql`

mutation($id: ID!){
    deleteDistrict(id:$id){
        id
    }
}


`

export {getDistrictsQuery, getProjectsQuery, getProjectQuery, addProjectMutation, addDistrictMutation, deleteProjectMuattion, deleteDistrictMutation};
